    const title = 'הוספת מערכת';
    const fabStyle = {
        margin: 0,
        top: 'auto',
        right: 'auto',
        bottom: 20,
        left: 20,
        position: 'fixed',
    };

    const makeTrigerBtn = (additionalProps) => {
        return (
            <Fab onClick={additionalProps.onClick} style={fabStyle} title='הוסף מערכת' color='info'>
                <AddIcon/>
            </Fab>
        )
    }

    const body = (
        <div style={{textAlign : 'center'}}>
            <h3>מזהה משתמש</h3>
            <p>{props?.userId}</p>
            <Divider/>
            <h3>שם משתמש</h3>
            <p>{username}</p>
        </div>
    )

    return (
        <div>
            <ModalTemplate 
                closeBtn 
                body={body} 
                title={title} 
                closeTxt={'סגור'}
                makeTrigerBtn={makeTrigerBtn}
            />
        </div>
    );
}

export default AddNewSystemModal;
